try {
    function createCourseElement (instructor, course, parentDiv){
        const courseDiv = document.createElement('div');
        courseDiv.innerHTML = `
            <div class='grid'>
                <img src=${course.img} class='course_img'>  
                <div class='course_info'>
                    <span class='title'>${course.course_name}</span>
                    <span class='course_instructor'> ${instructor}</span>
                    <div class='info'><span class='course_rating'> ${course.rating}/5</span>
                        <span class='course_price'> ${course.price}</span>
                        <span class='course_duration'> ${course.duration}</span>
                    </div>
                    <a href="/payment"  class="link" style=" text-decoration: none; "> <button class='course-btn'><i class="fa-solid fa-rupees fa-xl" ></i>Buy Now</button></a>
                </div>
            </div>
        `;
    
        parentDiv.appendChild(courseDiv);
    
     

        const courseBtn = courseDiv.querySelector('.course-btn');
        courseBtn.addEventListener('click', (event) => {
            const parentDiv = event.target.closest('.grid');
            const courseImg=parentDiv.querySelector('.course_img').src
            const courseInstructor=parentDiv.querySelector('.course_instructor').textContent;
            const courseInfo = parentDiv.querySelector('.title').textContent;
            const coursePrice = parentDiv.querySelector('.course_price').textContent;
            const courseDuration = parentDiv.querySelector('.course_duration').textContent;
           
            
            sessionStorage.setItem('courseImg',courseImg)
           sessionStorage.setItem('CourseName',courseInfo)
           sessionStorage.setItem('courseInstructor',courseInstructor)
           sessionStorage.setItem('Price',coursePrice)
           sessionStorage.setItem('Duration',courseDuration)
           location.href='/payment'
        });
    };

    
}
finally {
    document.querySelector('.loader').classList.add("loader-hidden");


}



const createCourseElements = () => {
    for (const courseKey in courses) {
        const CoursesDiv = document.getElementById(courseKey);
        const courseObj = courses[courseKey];
        for (const instructor in courseObj) {
            createCourseElement(instructor, courseObj[instructor], CoursesDiv);
        }
    }

}





